            },
            {
              id : 2,
              name : 'XYZ',
              age : 20
            },
            {
              id : 3,
              name : 'JKG',
              age : 30
            }

          ];
      return (
        <div>
          <nav className="navbar navbar-inverse">
            <div className="container-fluid">
              <a className="navbar-brand">Title</a>
              <ul className="nav navbar-nav">
                <li className="active">
                  <a>Home</a>
                </li>
                <li>
                  <a>Link</a>
                </li>
              </ul>
            </div>
          </nav> 
          <div className="ml-30">
          <h2>
            a : {a} <br/>
            b : {b} <br/>
            a + b = {a + b}
          </h2>

          {this.showInfoProduct(product)}


          </div>
        </div> 
      );
    }
  }


export default App;
